MongoDb, prevent from creating same object two times<p>The thing I had to do was to create database with MongoDb, Node.js and connect with WebSocket server, and keep updating database with data sent from Websockets. Websockets sends many kind of data connected to particular id of device. Works fine, connection is established, it keeps updating Mongo but the thing is that sometimes when data about particular device is sent first time, it creates same object twice. Not sure If I explained correctly what I mean, but idea is to not let Mongo double device while creating it.</p>

<pre><code>connection.onmessage = e =&gt; {
    const resp = JSON.parse(e.data)
    const server_name = e.target._socket._host.slice(0, 5)
    setTimeout(() =&gt; {
        push_data_to_database(resp, server_name)
    },500)
</code></pre>

<p>}</p>

<pre><code>push_data_to_database = (message, server) =&gt; {
    // console.log("data::::", message)
    deviceControllers.addDevice({device_id: message.device_id, server_name: server})

    if (message.event == 'SCRIPT_START') {
        deviceControllers.updateDevice(
            {device_id: message.device_id},
            {scriptexecute_timestamp: message.timestamp}
        )
    } 
}
</code></pre>

<p>And Function to add device to database</p>

<pre><code>exports.addDevice = async(req, resp) =&gt; {
    try {
        const validation = await Device.find(req)
        if (!validation.length &amp;&amp; req.device_id !== undefined) {
            const device = new Device(req)
            console.log('added:',device)
            return device.save()
        }
    }
    catch (err) {
        throw err
    }
}
</code></pre>

