MongoDB aggregate fields without knowing all the fields before hand<p>How can I compute the aggregate of the following metrics without knowing all the metrics before hand? Can I accomplish this using the aggregate framework or MapReduce?</p>

<pre><code>[
  {
   player_id: '123',
   timestamp: &lt;sometime&gt;,
   metrics: {
     points_per_game: 1,
     rebounds_per_game: 2,
     assist_per_game: 3,
   }
  },
  {
    player_id: '123',
    timestamp: &lt;sometime&gt;,
    metrics: {
      points_per_game: 1,
      rebounds_per_game: 2,
    }
  },
  {
    player_id: '345',
    timestamp: &lt;sometime&gt;,
    metrics: {
      points_per_game: 1,
      rebounds_per_game: 2,
      point_in_the_paint_per_game: 2
    }
  }
]
</code></pre>

<p>I would like to have the following  result</p>

<pre><code>[
 {
   player_id: '123',
   metrics: {
     points_per_game: 2,
     rebounds_per_game: 4,
     assist_per_game: 3,
   }
 },
 {
   player_id: '345',
   metrics: {
     points_per_game: 1,
     rebounds_per_game: 2,
     point_in_the_paint_per_game: 2
   }
 }
]
</code></pre>

<p>I cannot do something like the following since it would require me to know every metrics:</p>

<pre><code>db.stats.aggregate([
   {$group: {
     _id: {player: "$player_id"},
